    false,nt"url": null,nt"notes": "The U.S. Geological Survey (USGS) St. Petersburg
    Coastal and Marine Science Center (SPCMSC) and the USGS Lower Mississippi-Gulf Water
    Science Center (LMG WSC) in Montgomery, Alabama, collected terrestrial-based light
    detection and ranging (T-lidar) elevation data at Fire Island, New York. The data
    were collected on May 18, 2015 as part of the ongoing beach monitoring within Hurricane
    Sandy Supplemental Project GS2-2B, and will be used to document and assess the morphological
    storm response and post-storm beach recovery. The survey extended along 30 kilometers(km)
    of the Fire Island National Seashore, from the eastern boundary of Robert Moses
    State Park to the western boundary of Smith Point County Park. This USGS Data Release
    includes the resulting processed elevation point data (xyz) and an interpolated
    digital elevation model (DEM). For further information regarding data collection
    and/or processing methods, refer to previously published USGS Data Series 980 (http://dx.doi.org/10.3133/ds980).",nt"license_title":
